import React from 'react';
import logo from './logo.svg';
import './App.css';

const testData = [{
ID:"324",
  Name: "gilad",
}]
const TableHeader = ()=>{
  return (
  <tr>
    <td> ID</td>
    <td> Name</td>
  </tr>)
}

const OneCient = (props)=>{
  return (
  <tr>
    <td>{ props.ID}</td>
    <td> { props.Name}</td>
  </tr>)
}
const TableValues = ()=>{
 return(<OneCient/>);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <table  border="1">
          <TableHeader/>
          <TableValues/>
        </table>
      </header>
    </div>
  );
}

export default App;
